function App() {
  const num = 3;
  const rest = 10;

  return (
    <>
      <h1> Workout Timer</h1>
      <div style={{ height: "15em", width: "25em", backgroundColor: "red", textAlign: "center", display: "flex", flexDirection: "column", justifyContent: "space-evenly" }}>
        <div>
          <i>{num} sets of workout with {rest}s rest in between</i>
        </div>
        <b style={{ fontSize: "2.5em" }}>00 : 00</b>
        <button style={{ alignSelf: "center", width: "5em" }}>Start</button>
      </div>
    </>
  );
}

export default App;
